  false,\n\t\"url\": null,\n\t\"notes\": \"United States Mint - Bureau of Engraving
  and Printing Facilities This dataset includes facilities of the United States Mint
  and facilities of the Bureau of Engraving and Printing. There are entities within
  this dataset that are also included in the HSIP Gold Bullion Repositories 2006 Q3
  dataset as these entities are considered to a bullion repository as well as a US
  Mint. The currentness of this dataset is indicated by the more recent date of the
  [CONTDATE] attribute and the [GEODATE] attribute. Based upon these attributes the
  oldest record dates from 07/19/2006 and the newest record dates from 07/24/2006.
  The most current [CONTDATE] is the most current contact date as provided by TGS.
  Due to the sensitive nature of these entities, TGS did not make contact with the
  entities within this dataset during this processing.\",\n\t\"license_title\": \"License
